%[text] ## stabilité
%[text] ### En realisant le produit avant entre phasor, puis en construitant le probleme TB LMI
h=10 %[output:6e9a32a9]

P2=sdpvar(size(A,1),size(A,2),h,'symmetric','complex');
P1=ndsdpvar(size(A,1),size(A,2),1,'symmetric','real');
P = PosPart2PhasorArray(P1,P2);

PT=P.TB(h);
t1=tic();

%produits entre les objets phaseur
ATP=(A.')*P;
PA=P*A;
ATPpPA=(ATP+PA) %[output:6cd9f7e6]

%Construction de la Toeplitz Blocks Matrix (matrice à blocs toeplitz)
ATPpPA.TB(h);

F=[PT>=0,ATPpPA.TB(h) + NTB(nx,h,1)*PT-PT*NTB(nx,h,1)<=-(eye(size(A.TB(h),1))*10)] %[output:6700fd06]
toc(t1) %[output:2f6d3efd]
optimize(F) %[output:0a7e0f84] %[output:0a99fec4]
toc(t1) %[output:15edb4ce]
%
