%[text] ## Riccati LMI
%[text] $A^T P +PA -(PB +N^T)R^{-1}(B^T P +N) + Q \\geq 0$
%[text] $\\left\[\\matrix{A^TP +PA  +Q & PB +N^T \\cr (PB +N^T)^T & R} \\right\] \>0$
%[text] 
nx=2;
nu=2;

ha=3; %nombre de phasor dans A
hP=10; %nombre de phasor dans P, var de decision
h=10; %truncature order

T=3; %period

A=PhasorArray.random(nx,nx,ha,"time_structure","real");
figure(500) %[output:842c13ed]
clf %[output:842c13ed]
A.plot(T) %[output:842c13ed]
figure(501) %[output:27307a70]
clf %[output:27307a70]
plot(A.HmqNEig,'*') %[output:27307a70]


B=rand_phasor(nx,nu,ha,"output","PhasorArray");

%%%%% controllability criteria
%%% (A-N)W + W(A-N) + BB' iff Re(eig(A-N))<0

Pc=mreal(PhasorArray(Sylv_harmonique(A,A',B*B.',2*hP,1)));
figure(502) %[output:35e13f0d]
plot(Pc) %[output:35e13f0d]
trace(Pc).phas(0) %[output:4bbeb4f3]
 

%liste de sdp var servant aux phaseur 
P=PhasorArray.ndsdpvar(nx,nx,hP,"PhasorType",'symmetric',"real",true) %[output:8e2d4d07]
PT=P.TB(h);

Q=PhasorArray(eye(nx));
QT=Q.TB(h);

R=PhasorArray(eye(nu));
RT=Q.TB(h);

N=PhasorArray(zeros(nu,nx));


[AHpJ,AJHm,AHp,AHm]=A.TBHankel(h);
[AtHpJ,AtJHm,AtHp,AtHm]=TBHankel(A.',h);

[PHpJ,PJHm,PHp,PHm]=P.TBHankel(h);
[BHpJ,BJHm,BHp,BHm]=B.TBHankel(h);

ATB=A.TB(h);
BTB=B.TB(h);

NT=N.TB(h);

F0=[PT>=0] %[output:7d048e50]

F11=[ATB'*PT+PT*ATB+...
AtHp*PHm+PHp*AHm+...
AtJHm*PHpJ+PJHm*AHpJ+...
NTB(A,h,T)*PT-PT*NTB(A,h,T)+QT];

F12=[PT*BTB+PHp*BHm+PJHm*BHpJ+NT'];

F21=F12';

F22=R.TB(h);

F1=[F11,F12;F21,F22];


F=[F0,F1>=0] %[output:391c7522]

obj=-trace(PT) %[output:0249c5e5]
optimize(F,obj) %[output:7ac3aed2] %[output:6a9c9f8c]


