%[text] ## H2 LMI
%[text] $A^T P +PA +\\gamma^{-1}PBB^T P + C^TC  \\leq 0$
%[text] $\\left\[\\matrix{A^TP +PA  +C^TC & PB  \\cr (PB)^T & -\\gamma I} \\right\] \<0$
%[text] 
nx=2;
nu=2;
