[PHpJ,PJHm,PHp,PHm]=P.TBHankel(h);
[BHpJ,BJHm,BHp,BHm]=B.TBHankel(h);

ATB=A.TB(h);
BTB=B.TB(h);


F0=[PT>=0] %[output:1f64c10f]

F11=-[ATB'*PT+PT*ATB+...
AtHp*PHm+PHp*AHm+...
AtJHm*PHpJ+PJHm*AHpJ+...
NTB(A,h,T)*PT-PT*NTB(A,h,T)+QT];

F12=[PT*BTB+PHp*BHm+PJHm*BHpJ];

F21=F12';

F22=-gam.TB(h);

F1=[F11,F12;F21,F22];


F=[F0,F1<=0] %[output:652d53ca]

obj=trace(gam{:,:,0}) %[output:0f034076]
optimize(F,obj) %[output:3dffdb0d] %[output:0ab50065]


